INSERT INTO `categoris` (`id`, `titre`, `description`, `image_categorie`, `created_at`, `updated_at`) VALUES
(10, 'BATTERIE GEL', 'batteries à l\'électrolyte gélifié', '1829580019350788.BATTERIES PLOMB et lithium.jpg', '2024-06-25 09:10:19', '2025-04-16 18:11:14'),
(11, 'KITS, PACKS et ASSEMBLAGE', 'assemblage non compact avec possibilité d\'assembler sous forme compacte dans un boitier et ayant pour but de résoudre un problème de consommation spécifique bien circoncis', '1833998526305137.PACKS.jpg', '2024-06-25 09:14:49', '2025-06-04 12:41:30'),
(12, 'CONTRÔLEUR DE CHARGE PWM', 'contrôleur de charge qui limite les niveaux des paramètres de charge venant  des panneaux en direction des batteries', '1833986349561920.Cathalogue Controleur PWM.jpg', '2024-06-25 09:17:13', '2025-06-04 09:27:58'),
(14, 'CONTROLEUR DE CHARGE MPPT', 'régulateur de charge modifiant les caractéristiques de départ du champ photovoltaïque pour les adapter à l\'état de la batterie en vu de soustraire le maximum de puissance du panneau et de le transmettre aux batteries', '1833986372021025.Cathalogue Controleur MPPT.jpg', '2024-06-25 09:21:25', '2025-06-04 09:28:19'),
(15, 'RAILS, CLAMP ET FIXATION PANNEAUX', 'éléments permettant de fixer le panneau solaire au toit ou sur structure au sol', '1833986455707521.Cathalogue Rails, Clams et fixations.jpg', '2024-06-25 09:31:57', '2025-06-04 09:29:39'),
(16, 'CONNECTEURS MC4', 'connecteurs permettant de lier le panneau solaire aux câblages de la suite de l\'installation', '1833986486930703.Cathalogue Connecteur MC4.jpg', '2024-06-25 09:36:39', '2025-06-04 09:30:09'),
(17, 'CÂBLES', 'Cable solaire, Cable pour installation DC, Cable pour installation AC, Cable image, Cable RG59', '1833986504576373.Cables.jpg', '2024-06-25 09:56:43', '2025-06-04 09:30:26'),
(18, 'CONVERTISSEUR SINUS MODIFIER', 'Un convertisseur sinus modifié (ou onduleur à onde sinusoïdale modifiée) peut être utilisé dans une installation solaire, Il transforme le courant continu (DC) de votre batterie solaire en courant alternatif (AC) avec une onde pseudo-sinusoïdale (pas parfaitement lisse comme l’onde du réseau électrique).', '1833986531250890.Cathalogue Convertisseur SInus modifier.jpg', '2024-06-25 10:02:51', '2025-06-04 09:30:51'),
(19, 'CONVERTISSEUR PURE SINUS', 'PURE SINE CONVERTERS and hybrid converters', '1833986560116887.Cathalogue Convertisseur hybride pure sinus.jpg', '2024-06-25 10:03:21', '2025-06-04 09:31:19'),
(20, 'LAMPE DC', 'Conçue pour fonctionner directement avec une alimentation en courant continu, comme celle produite par des panneaux solaires, des batteries ou des alimentations 12V .', '1833986693923035.Cathalogue Lampes DC.jpg', '2024-06-25 10:13:47', '2025-06-04 09:33:26'),
(21, 'PANNEAUX SOLAIRES', 'photovoltaïque', '1829765064767077.AVAILABLE SOLAR PANELS.jpg', '2024-06-25 10:39:06', '2025-04-18 19:12:27'),
(23, 'VENTILATEUR SOLAIRE', 'SOLAIRE SIMPLE\nSOLAIRE HYBRIDE\nSOLAIRE AUTONOME', '1833986759421354.Cathalogue Ventilateur solaire.jpg', '2024-06-29 10:24:04', '2025-06-04 09:34:29'),
(25, 'INTERRUPTEUR- PRISES', 'ENCASTRÉ:\n- SIMPLE ALUMAGE\n-simple va et viens\n- double simple\n- double va et viens \n- bouton poussoir\n- prises \n\nAPPARENTS:\n- SIMPLE ALUMAGE\n-simple va et viens\n- double simple\n- double va et viens \n- bouton poussoir\n- prises', '1833986826600216.Cathalogue INTERRUPTEUR ET PRISES.jpg', '2024-07-01 09:49:37', '2025-06-04 09:35:33'),
(26, 'FIXATION', 'ATTACHES\nVICES \nCHEVILLES', '1833986855582762.Cathalogue ATTACHE.jpg', '2024-07-01 15:52:32', '2025-06-04 09:36:00'),
(27, 'IMAGES', 'TELEVISEUR\nDECODEUR\nPARABOLE', '1833993237859376.PARABOLE COMPLETE.jpg', '2024-07-01 15:54:13', '2025-06-04 11:17:27'),
(28, 'PLOMBERIE', 'tuyaux \nraccords\ncubitenaire', '1833986884034347.Cathalogue Plombérie.jpg', '2024-07-09 11:50:03', '2025-06-04 09:36:27'),
(29, 'TELEVISEUR', 'Appareil électronique conçu pour recevoir, décoder et afficher des images et du son en provenance de diverses sources (antenne, câble, satellite, Internet, lecteur multimédia, etc.). Aujourd\'hui, les téléviseurs modernes offrent des fonctionnalités avancées telles que l\'accès à Internet, le streaming, les jeux, et bien plus encore.\n- 19\'\'\n- 22\"\n-24\"\n- 26\"\n- 28\"\n- 32\"\n- 37\"\n- 42\"\n- 43\"\n- 46\"\n- 48\"\n- 50\"\n- 55\"', '1833986923107851.Cathalogue téléviseur.jpg', '2024-07-09 14:35:10', '2025-06-04 09:37:05'),
(30, 'CONNECTEUR', 'Appareillage utilisé pour la connexion de circuits ou d\'appareils.', '1833986950376191.Cathalogue connecteur électrique.jpg', '2024-07-12 12:15:00', '2025-06-04 09:37:31'),
(32, 'LAMPES ET LUSTRE AC', 'Lampes base consommation pour les système solaire', '1833986977058353.Cathalogue Lampes AC.jpg', '2024-07-26 10:09:58', '2025-06-04 09:37:56'),
(33, 'PROTECTION ELECTRIQUE DPN ,PARAFOUDRE ET LIMITEUR DE TENSION', 'Dispositif de sécurité utilisé dans les installations électriques pour protéger les circuits contre les surintensités, les courts-circuits et les défauts de terre. Protège les installations électriques et les équipements contre les surtensions transitoires générées principalement par la foudre\n...', '1833987049100342.Cathalogue disjoncteur .jpg', '2024-09-16 12:43:00', '2025-06-04 09:39:05'),
(34, 'INVERSEUR DE SOURCE', 'Dispositif électrique permettant de basculer automatiquement ou manuellement l\'alimentation électrique entre deux sources distinctes. Il est souvent utilisé pour garantir une alimentation continue en cas de coupure de courant, en passant d\'une source principale (réseau électrique) à une source secondaire (générateur, panneaux solaires, batterie).', '1833987115073734.Cathalogue inversseur de source.jpg', '2024-09-20 12:09:08', '2025-06-04 09:40:08'),
(35, 'POMPE SOLAIRE DC ET AC/DC', 'Dispositif permettant de pomper de l\'eau en utilisant l\'énergie fournie par le soleil. La pompe solaire fonctionne en courant continue et ou en courant alternatif', '1833987163400143.Cathalogue pompe DC et AC-DC.jpg', '2024-10-02 12:14:39', '2025-06-04 09:40:54'),
(36, 'GENERATEUR SOLAIRE ET PACK', 'système autonome qui convertit l\'énergie solaire en électricité grâce à des panneaux photovoltaïques. Il permet d\'alimenter divers appareils électriques, même en l\'absence de réseau électrique, en stockant l\'énergie dans des batteries.', '1833987205122206.Cathalogue GENERATEUR SOLAIRE.jpg', '2024-11-02 10:38:55', '2025-06-04 09:41:34'),
(37, 'PROJECTEUR ET LAMPADAIRES', 'Pour éclairage extérieur', '1833987237158595.Cathalogue Lampadaire et projecteurs.jpg', '2024-11-02 16:25:58', '2025-06-04 09:42:04'),
(38, 'POMPE AC', 'Pompe électrique a courant alternatif 230Vac', '1833987331065359.Cathalogue Pompe AC.jpg', '2025-02-12 18:03:57', '2025-06-04 09:43:34'),
(40, 'OUTILS DE MESURES', 'WATTMÈTRE\nMULTIMETRE\nMETRES', '1833987349747450.Cathalogue appareils de mesure.jpg', '2025-03-10 17:30:50', '2025-06-04 09:43:52'),
(42, 'BATTERIE LITHIUM-ION', 'Dispositif de stockage d\'énergie électrique utilisant le lithium comme élément actif.', '1833987398129193.Cathalogue BATTERIE LITHIUM.jpg', '2025-03-19 11:54:29', '2025-06-04 09:44:38'),
(43, 'VIDEO SURVEILLANCE', 'Intègre tout les équipements de vidéo surveillance', '1829765870837670.VIDEO SURVEILLANCE.jpg', '2025-04-17 16:52:18', '2025-04-18 19:25:16'),
(44, 'COFFRET ET BOITTE DE DERIVATION ELECTRIQUE', 'Protection des circuits électriques contre les chocs mécanique, intempéries et poussière.', '1833987376816833.Cathalogue Boitte et coffret.jpg', '2025-05-12 14:16:24', '2025-06-04 09:44:17'),
(45, 'COSSE BATTERIE', 'Les cosses de batterie sont des connecteurs métalliques utilisés pour fixer les câbles électriques aux bornes d\'une batterie. Elles sont conçues pour assurer un bon contact électrique et minimiser les pertes de courant.', '1833987415992907.Cathalogue Cosse bat.jpg', '2025-05-14 15:15:15', '2025-06-04 09:44:55');
