INSERT INTO `packs` (`id`, `titre`, `description`, `prix`, `image`, `created_at`, `updated_at`) VALUES
(1, 'Pompe solaire + système énergétique 60 mètres 3000 litres par heures', 'DERNIÈRES UNITÉS DISPONIBLES ! Faites-vous installer votre pompe solaire avec système énergétique complet dès maintenant et profitez d’une autonomie totale en eau, sans facture d’électricité ni carburant à payer. 💧 Bonus : possibilité de compléter avec les éléments de plomberie pour le raccordement au cubitainer du client (seulement 75 000 FCFA) ! 🎯 Ne ratez pas cette offre exceptionnelle avant épuisement du stock. 📞 Commandez maintenant 657 24 89 25 / 678 64 51 11 Solergy Solutions SARL – L’eau, sans limite.', '488700', '1833568942956798.POMPAGE 60M.jpg', '2025-05-30 18:53:28', '2025-06-05 12:26:41'),
(2, 'TV solaire 26\"+ 6 AMPOULES SOLAIRES + Images gratuites+ alimentation solaire', '🔋🌞 PACK ÉNERGIE SOLAIRE COMPLET – TV 26’’ + 6 AMPOULES\nÉclairez, regardez, économisez – même en plein délestage !\n\nOffrez à votre foyer une autonomie énergétique totale grâce à notre Pack Solaire tout-en-un : une solution fiable, économique et prête à l’emploi. Ce système alimente une TV jusqu’à 26’’, 6 ampoules LED puissantes, et inclut des contenus multimédia gratuits pour toute la famille.\n\n✅ Contenu du pack :\n\n1 système solaire (batterie + panneau + régulateur et raccordements fournis )\n\nCompatibilité TV jusqu’à 26’’ solaire offert\n\n6 ampoules LED solaires à longue autonomie\n\nImages et vidéos gratuites (clé USB ou carte SD)\n\nTous les câbles et accessoires fournis\n\nInstallation facile : 247 000 FCFA le matériel  et 280 000 FCFA avec installation\n\n💡 Avantages clés :\n\nZéro carburant, zéro facture d’électricité\n\néclairage de 18 heure à 23 heure \n\nTV fonctionnelle même sans courant\n\nSystème sécurisé, durable et économique\n\n🎯 Idéal pour : foyers en zone rurale, familles, étudiants, petits commerces, fermes, salons...\n\n🛒 Commandez maintenant et rejoignez les nombreux foyers déjà équipés par Solergy Solutions SARL.\n📦 STOCK LIMITÉ – Faites vite !\n📞 (+237) 657 24 89 25 / 678 64 51 11\nSolergy – Votre autonomie commence ici.', '247000', '1833569353649988.kit tv 24 pouces 6 ampoules solaires.jpg', '2025-05-30 18:59:59', '2025-06-03 13:50:15'),
(3, 'pompe solaire + système énergétique 50 mètres 1000 litres par jours', '🚨 DERNIÈRES UNITÉS DISPONIBLES !\nFaites-vous installer votre pompe solaire avec système énergétique complet dès maintenant et profitez d’une autonomie totale en eau, sans facture d’électricité ni carburant à payer.\n\n💧 Bonus : possibilité de compléter avec les éléments de plomberie pour le raccordement au cubitainer du client (seulement 50 000 FCFA) !\n\n🎯 Ne ratez pas cette offre exceptionnelle avant épuisement du stock.\n📞 Commandez maintenant  657 24 89 25 / 678 64 51 11\nSolergy Solutions SARL – L’eau, sans limite.', '220300', '1834014134998367.POMPAGE 250K 50 mètres manuelle.jpg', '2025-06-04 16:49:36', '2025-06-04 16:49:36'),
(4, 'Pompe solaire + système énergétique 110 mètres 3600 litres par heures', 'DERNIÈRES UNITÉS DISPONIBLES ! Faites-vous installer votre pompe solaire avec système énergétique complet dès maintenant et profitez d’une autonomie totale en eau, sans facture d’électricité ni carburant à payer. 💧 Bonus : possibilité de compléter avec les éléments de plomberie pour le raccordement au cubitainer du client (seulement 90 000 FCFA) ! 🎯 Ne ratez pas cette offre exceptionnelle avant épuisement du stock. 📞 Commandez maintenant 657 24 89 25 / 678 64 51 11 Solergy Solutions SARL – L’eau, sans limite.', '635000', '1834086848280343.Pompage 110m.jpg', '2025-06-05 12:05:21', '2025-06-05 12:24:01'),
(5, '3500Wh/Jr  POUR RENDRE AUTONOME UNE MAISON CLASSIQUE ', ' Le choix intelligent\nPourquoi continuer à payer pour un courant qui vous lâche dès que le vent souffle fort ou qu’il veut pleuvoir ?\nNotre système 3500W/jour couvre vos besoins réels : congélateur TV, ampoules, ventilateur solaire, téléphones, décodeur, woofer…\n\n✔ Moins coûteux\n✔ Toujours disponible\n✔ Installation rapide et sécurisée\n\nFaites un choix logique : investissez une fois, profitez tous les jours.\n✅ Commandez maintenant sur notre site.', '973400', '1834284541914255.pack 3500 wh_jr.jpg', '2025-06-07 16:27:36', '2025-06-07 16:27:36'),
(6, 'BACKUP SECOURS ANTIDELESTAGE BUREAU', '**Alimentez votre activité sans interruption avec notre solution bureau**\n\nLes coupures d’électricité ralentissent votre productivité ? Solergy Solutions a conçu une **solution solaire optimisée** spécialement adaptée aux BUREAUX  exigeants.\n\n🔋 Alimente en toute autonomie :\n\n*  grand copieur (1800W)\n* 1 imprimante (400W)\n*  desktop (150W)\n*  ordinateurs portables\n*  ampoules LED \n*  ventilateurs\n\n💡 Résultat : **zéro interruption**, **zéro bruit**, **zéro carburant**, et une **économie durable** sur vos coûts d’énergie.\n\n🎯 Ne laissez plus les délestages freiner vos activités.\n👉 **Réservez dès maintenant sur notre site web** pour garantir la continuité de vos opérations, même en pleine coupure.\n**Solergy Solutions – L’énergie qui soutient votre performance.**\ntéléphone:  (+237) 6 57 24 89 25 - 6 78 64 51 11\n', '654600', '1834308281543879.pack backup bureau 3500 wh_jr.jpg', '2025-06-07 22:44:56', '2025-06-07 22:44:56'),
(7, 'production solaire 130Wh/Jr – Éclairage & recharge autonome du téléphone ', 'Solution solaire 130Wh/Jr – Éclairage & recharge autonome du téléphone \n\nCette solution compacte de 130Wh/jour a été spécialement conçue pour alimenter 3 réglettes solaires Solergy et recharger un téléphone, de manière totalement autonome de 18H jusqu’au coucher. \n\n\nIdéale pour les foyers, commerces ou zones sans électricité, elle garantit un éclairage fiable et une communication assurée chaque soir, sans dépendre du réseau.\nréservez pour vous maintenant au \n\n(+237) 6 57 24 89 25 - 6 78 64 51 11', '52700', '1834808761948368.pack 130 wh_jr.jpg', '2025-06-13 11:19:51', '2025-06-13 11:19:51'),
(8, '105000 pour 5 lampes+charge du téléphone ', 'Solution Ultra économique tout équipement inclus pour alimenter :\n✅ Une production de 200wh/jr d\'énergie au minimum \n\n✅ 5 ampoules solaires (câble et accessoires inclus) ;\n✅ Charge du téléphone même Android ;\n\n', '98100', '1839349848973827.flyers différents petits systemes.png', '2025-08-02 14:18:29', '2025-08-02 14:18:29'),
(9, 'PRODUCTION CLASSISQUE 1500Wh/jr ', '✅ Capacités du Pack :\n💡 8 lampes LED de 9W – Éclairage performant et économe pour toutes vos pièces.\n📺 1 Téléviseur de 60W – Suivez vos émissions préférées sans interruption.\n💻 1 Ordinateur portable – Charge complète pour le travail, les études ou les loisirs numériques.\n🌬️ 2 ventilateurs solaires de 15W – Rafraîchissement garanti pendant les journées chaudes.\n📱 Chargement de téléphones – Jusqu’à plusieurs téléphones simultanément.\n🎯 Avantages :\n🔋 Indépendance énergétique : Fonctionne sans groupe électrogène ni réseau.\n🛠️ Installation facile et rapide par nos techniciens.\n⚡ Zéro bruit, zéro carburant, 100 % énergie renouvelable.\n🔆Idéal pour : maisons, boutiques, zones rurales ou à faible accès à l’électricité.', '430600', '1839353106860675.1500WHjr production classique.jpg', '2025-08-02 15:10:16', '2025-08-02 15:10:16'),
(10, 'PRODUCTION PREMIUM 1500Wh/jr ', '✅ Capacités du Pack : 💡 8 lampes LED de 9W – Éclairage performant et économe pour toutes vos pièces. 📺 1 Téléviseur de 60W – Suivez vos émissions préférées sans interruption. 💻 1 Ordinateur portable – Charge complète pour le travail, les études ou les loisirs numériques. 🌬️ 2 ventilateurs solaires de 15W – Rafraîchissement garanti pendant les journées chaudes. 📱 Chargement de téléphones – Jusqu’à plusieurs téléphones simultanément. 🎯 Avantages : 🔋 Indépendance énergétique : Fonctionne sans groupe électrogène ni réseau. 🛠️ Installation facile et rapide par nos techniciens. ⚡ Zéro bruit, zéro carburant, 100 % énergie renouvelable. 🔆Idéal pour : maisons, boutiques, zones rurales ou à faible accès à l’électricité.', '556600', '1839354127639426.1500WHjr production premium.jpg', '2025-08-02 15:26:30', '2025-08-02 15:26:30'),
