INSERT INTO `services` (`id`, `name`, `description`, `image`, `status`, `created_at`, `updated_at`) VALUES
(1, 'POMPAGE SOLAIRE', 'Pompage Solaire – L\'eau en toute autonomie\nChez Solergy Solutions SARL, notre service de pompage solaire vous garantit un accès permanent à l’eau, même dans les zones les plus reculées. Alimentés par l’énergie solaire, nos systèmes éliminent définitivement les factures d’électricité et offrent une alternative ultra-économique aux pompes classiques.\n\nFiables, durables et écologiques, nos solutions sont conçues pour répondre efficacement aux besoins agricoles, domestiques ou industriels. Avec le meilleur rapport qualité-prix du marché, Solergy vous assure une autonomie totale à un coût imbattable.', '1833905825137253.POMPAGE SOLAIRE CONTROLEUR EXTERNE HMT60-3L.jpg', 'actif', '2025-04-16 18:48:43', '2025-06-03 12:08:04'),
(2, 'INSTALLATION SOLAIRE AUTONOME', 'Alimentation Solaire Autonome – Votre liberté énergétique commence ici\nLibérez-vous définitivement des coupures et des factures d’électricité avec notre solution d’alimentation solaire autonome. Conçue pour fournir une énergie sûre et ininterrompue, cette solution remplace avantageusement les groupes électrogènes et l’abonnement au réseau électrique national.\n\nElle est 8,9 fois plus économique qu’un système à carburant (plus de 700 FCFA/litre sans oublier les pannes fréquentes ), plus sécurisée grâce à l’absence de liquides inflammables et variations imprévisibles de tension, et plus fiable, car elle limite les pannes lorsqu’elle est bien dimensionnée et réalisée avec du matériel de qualité. De plus, plus jamais de quittance d’électricité : votre énergie devient totalement indépendante.\n\nEt le tout, avec le meilleur rapport qualité-prix du marché.\n\n📞 Commandez votre solution maintenant au (+237) 6 57 24 89 25 - 6 78 64 51 11\nSolergy Solutions SARL – L’énergie sans compromis.', '1829590513119302.WhatsApp Image 2025-03-24 at 10.33.32 (1).jpeg', 'actif', '2025-04-16 20:58:01', '2025-06-03 12:39:10'),
(3, 'FORMATION DES TECHNICIENS ET TECHNICO-COMMERCIAUX', 'Formez-vous avec SOLERGY SOLUTIONS : Bâtissez l\'avenir solaire de l\'Afrique ;\n;\nChez Solergy Solutions, nous croyons que le développement de l’Afrique se fera à la fois en ville et en campagne. Pour ce faire, il faudra comme partout ailleurs, une abondance énergétique a la fois pour les besoins de la vie quotidienne, mais aussi pour notre industrie de transformation a grande, moyenne et petite échelle. Cette abondance énergétique passe par des hommes et des femmes bien formés, passionnés et compétents. C’est pourquoi nous avons mis en place un programme de formation de haut niveau, destiné aux techniciens et technico-commerciaux souhaitant se spécialiser dans le solaire photovoltaïque. ;\n;\nNos sessions allient théorie rigoureuse et pratique intensive sur les dernières technologies solaires, adaptées aux réalités du terrain camerounais et africain. Encadrés par des spécialistes chevronnés, les participants acquièrent les compétences nécessaires pour :;\n;\n-	Concevoir et dimensionner des systèmes solaires performants ;\n\n-	Installer et maintenir des équipements solaires de manière professionnelle ;\n\n-	Conseiller efficacement les clients en proposant des solutions adaptées à leurs besoins énergétiques. ;\n;\nRejoignez un réseau dynamique de professionnels solaires, prêts à relever les défis de l’électrification durable, à la ville comme en zone rurale. Avec SOLERGY SOLUTIONS, devenez acteur du changement, et apportez la lumière là où elle manque. ;\nNB : les meilleurs bénéficieront d’un accompagnement ;\n;\n> Investissez dans votre avenir. Formez-vous aujourd’hui. Brillez demain. ;\n;\n;\nContactez-nous dès maintenant au (+237) 657 24 89 25 / 678 64 51 11 ;\nLieu : Douala, en face de l’entrée du Collège Bénédicte ;', '1833908368311247.sité eyang configuration.jpeg', 'actif', '2025-05-04 09:04:36', '2025-06-03 12:48:29'),
(4, 'SECOURS BACKUP SOLAIRE ANTI DELESTAGE', 'Backup Solaire Anti-Délestage – L’énergie, sans interruption ni compromis\nAvec nos solutions d’alimentation solaire de secours, dites adieu aux coupures d’électricité et aux générateurs bruyants, coûteux et dangereux. Solergy Solutions SARL vous garantit une énergie disponible en permanence, propre, silencieuse et automatique.\n\n8,9 fois plus économique qu’un groupe électrogène (grâce à la suppression du carburant à plus de 700 FCFA/litre), notre système offre une sécurité renforcée sans manipulation de liquides inflammables. Fiable et durable, il réduit considérablement les risques de panne lorsqu’il est correctement dimensionné avec nos équipements de qualité.\n\nFini les factures d’électricité et les tracas des pannes fréquentes. Avec Solergy, vous bénéficiez du meilleur rapport qualité-prix du marché, pour une tranquillité d’esprit durable.', '1833906775142672.meublé 2 ange rapael.jpeg', 'actif', '2025-06-03 12:23:10', '2025-06-03 12:23:10');
